import React, { Component, Fragment } from 'react';
import './App.css';
import Canvas from './canvas';
class App extends Component {
  render() {
    return (
      <Fragment>
        <h3 style={{ textAlign: 'center' }}>My_Paint</h3>
        <div className="main">
          <div className="color-guide">
            <h5>Color Guide</h5>
            <div className="user user">Utilisateur</div>
            <div className="user guest">Invite</div>
          </div>
          <Canvas />
        </div>
      </Fragment>
    );
  }
}
export default App;
